       url: "https://www.wharton.upenn.edu/wp-content/plugins/m…h-chupacabra/includes/images/Wharton-Logo-RGB.png"
    },
    {
      url:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrKVeuUyaEJEV7AupWDU8lN5MCbME6poRxIZPs_FQ_&s"
    } 

  ]

function UnivAlum() {
  return (
    <div>
        <h1>University Alum Represent</h1>
        <Swiper
      spaceBetween={50}
      slidesPerView={3}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide>
        {
          Images.map((image))
        }
      </SwiperSlide>
    </Swiper>

    </div>
  );
}

export default UnivAlum
